import { INCREMENT_COUNT, DECREMENT_COUNT } from "./actionType";

const initialState = {
    cart: [{
        product_id: 1,
        quantity: 2
    }, {
        product_id: 2,
        quantity: 1
    }]
}

const cartReducer = (state = initialState, action) => {

    switch (action.type) {
        case INCREMENT_COUNT:
            return state;
        case DECREMENT_COUNT:
            return state;
            case DECREMENT_COUNT:
            return state;
        default:
            return state;
    }
}

export default cartReducer
